азать спасибо! Огромная благодарность Елене Викторовне Турлак за блестяще проведённую гистероскопию, Светлане Анатольевне Мельниковой за консультации и ее команде за прекрасные сны во время наркозов, Елене Леонидовне Соболевой за  эффективную диету для беременных, Юрию Леонидовичу Громыко за ведение беременности и прекрасные роды, команде эмбриологов и молекулярному цитогенетику Юлие Артемьевне Логиновой за профессионализм и волшебство, Эльвире Валентиновне за золотые руки, настойчивость, поддержку после переноса, за добрые улыбки при встрече и человеческое отношение. Отдельное спасибо Юлие ( ассистенту Эльвиры Валентиновны, к сожалению,  забыла фамилию) за правильный настрой и моральную поддержку при каждой встрече в Центре. Благодарю сотрудников стойки ресепшен за оперативную связь и деликатное отношение. Низкий поклон каждому из вас и искренняя благодарность за подаренное счастье! Благодарю Владислава Станиславовича Корсака за прекрасную команду профессионалов, желаю Центру и каждому подразделению процветания, каждому сотруднику увлеченности и максимальной отдачи от работы. Всем кто приходит в Центр, желаю исполнения мечты и движения к  заветной цели. ";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23774:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23774:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23774:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23774:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23774:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23555;a:24:{s:2:"ID";s:5:"23555";s:11:"ACTIVE_FROM";s:18:"16 марта 2015";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:26:"Елена и Сергей";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23555:21";s:20:"PROPERTY_EMAIL_VALUE";s:30:"filonencko.elena2015@yan